<div id="t3_54" class="t s3_54">Las aves también tienen respiración pulmonar, </div>
<div id="t4_54" class="t s3_54">mientras que los insectos respiran por medio de </div>
<div id="t5_54" class="t s3_54">tráqueas, a su respiración se le llama traqueal. </div>
<div id="t6_54" class="t s3_54">Las lombrices de tierra lo hacen a través de </div>
<div id="t7_54" class="t s3_54">la piel, este tipo de respiración se le llama </div>
<div id="t8_54" class="t s3_54">cutánea.</div>
